    <li>
      {/* <NavLink
        to="/signup"
        className={classes.link}
        activeClassName={classes.activeLink}
      >
        Sign up
      </NavLink> */}
    </li>
    <li>
      <NavLink
        to="/signin"
        className={classes.link}
        activeClassName={classes.activeLink}
      >
        Sign in
      </NavLink>
    </li>
  </ul>
);

export default AuthNav;
